import React, { useEffect, useState } from 'react';
import axios from 'axios';

const RecognitionTypeManagement: React.FC = () => {
  const [types, setTypes] = useState<any[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [page, setPage] = useState(0);
  const [pageSize, setPageSize] = useState(20);
  const [totalPages, setTotalPages] = useState(1);

  const fetchTypes = async (newPage = page, newPageSize = pageSize) => {
    setLoading(true);
    setError('');
    try {
      const token = localStorage.getItem('token');
      if (newPageSize < 1) newPageSize = 1;
      if (newPageSize > 100) newPageSize = 100;
      const res = await axios.get(`/recognition-types?page=${newPage}&size=${newPageSize}`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setTypes(res.data.content || []);
      setTotalPages(res.data.totalPages || 1);
      setPage(res.data.pageable?.pageNumber ?? newPage);
      setPageSize(res.data.pageable?.pageSize ?? newPageSize);
    } catch (err: any) {
      setError('Failed to fetch recognition types');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchTypes();
  }, []);

  return (
    <div style={{ width: '100%', overflowX: 'auto' }}>
      <h3 style={{ textAlign: 'center', fontSize: '1rem', fontWeight: 600, marginBottom: 12 }}>Recognition Types</h3>
      {loading && <div style={{ fontSize: '0.7rem' }}>Loading recognition types...</div>}
      {error && <div style={{ color: 'red', fontSize: '0.7rem', marginBottom: 8 }}>{error}</div>}
      <table style={{ width: '100%', fontSize: '0.7rem', background: '#fff', borderRadius: 8, boxShadow: '0 2px 8px #e0e0e0' }}>
        <thead>
          <tr style={{ background: '#8da1bd' }}>
            <th style={{ padding: 8 }}>Type Name</th>
            <th style={{ padding: 8 }}>Description</th>
            <th style={{ padding: 8 }}>Default Points</th>
          </tr>
        </thead>
        <tbody>
          {types.map(type => (
            <tr key={type.id} style={{ background: '#fff' }}>
              <td style={{ padding: 8 }}>{type.typeName}</td>
              <td style={{ padding: 8 }}>{type.description || '-'}</td>
              <td style={{ padding: 8 }}>{type.defaultPoints || '-'}</td>
            </tr>
          ))}
        </tbody>
      </table>
      {!loading && !error && types.length === 0 && (
        <div style={{ fontSize: '0.7rem', color: '#888', marginTop: 12 }}>No recognition types found.</div>
      )}
      <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'center', marginTop: 16, gap: 12 }}>
        <button style={{ fontSize: '0.7rem', padding: '4px 10px' }} disabled={page === 0} onClick={() => fetchTypes(0, pageSize)}>First</button>
        <button style={{ fontSize: '0.7rem', padding: '4px 10px' }} disabled={page === 0} onClick={() => fetchTypes(page - 1, pageSize)}>Prev</button>
        {Array.from({ length: totalPages }, (_, i) => i).map(i => {
          if (totalPages > 7 && Math.abs(i - page) > 2 && i !== 0 && i !== totalPages - 1) return null;
          return (
            <button
              key={i}
              style={{ fontSize: '0.7rem', padding: '2px 8px', margin: '0 2px', background: i === page ? '#8da1bd' : '#fff', border: i === page ? '1px solid #8da1bd' : '1px solid #ccc', borderRadius: 4 }}
              disabled={i === page}
              onClick={() => fetchTypes(i, pageSize)}
            >
              {i + 1}
            </button>
          );
        })}
        <button style={{ fontSize: '0.7rem', padding: '4px 10px' }} disabled={page + 1 >= totalPages} onClick={() => fetchTypes(page + 1, pageSize)}>Next</button>
        <button style={{ fontSize: '0.7rem', padding: '4px 10px' }} disabled={page + 1 >= totalPages} onClick={() => fetchTypes(totalPages - 1, pageSize)}>Last</button>
        <span style={{ fontSize: '0.7rem', marginLeft: 16 }}>Page size:</span>
        <input
          type="number"
          min={1}
          max={100}
          value={pageSize}
          onChange={e => {
            let val = Number(e.target.value);
            if (val < 1) val = 1;
            if (val > 100) val = 100;
            fetchTypes(0, val);
          }}
          style={{ width: 60, fontSize: '0.7rem', textAlign: 'center' }}
        />
      </div>
    </div>
  );
};

export default RecognitionTypeManagement;
